<template>
  <div class="hello">
  <el-row class="tl infog text">
    客户证件照片
  </el-row>
  <el-row :gutter="20">
    <el-col :span=12 class="center">
      <div class="papers-photo">
        <img :src = frontUrl alt="">
        
        <!-- <img src = '../assets/frontPhoto.png' alt=""> -->
      </div>
    </el-col>
    <el-col :span=12 class="center">
      <div class="papers-photo">
        <img :src = backUrl alt="">
        <!-- <img src = '../assets/reversePhoto.png' alt=""> -->
      </div>
