        <!-- <img src="../assets/perpr.png" alt=""> -->
      </div>
    </el-col>
    <el-col :span=12 class="center">
      <div class="peror-photo">
        <img :src = BASE64code alt="">
      </div>
    </el-col>
  </el-row>
  <el-row :gutter="20" style="margin:30px 0 10px 0">
    <el-col :span=12>
      <el-button @click="snap">抓拍</el-button>
    </el-col>
    <el-col :span=12>
      
    </el-col>
  </el-row>
   <div style="text-align:left" class="infog">
     <p>
       联网核查结果：
       <span>
         {{networkingVerificationResultId}} &nbsp;&nbsp;{{networkingVerificationResultName}}
       </span>
     </p>
     <p>
       人脸识别结果：
       <span v-show="retCode">
         {{sim}}分&nbsp;&nbsp;{{riskLevel}}
       </span>
     </p>
     <p>
       认证结果：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
       <span :class="certificationResult == '不通过' ? 'red' : 'green'">
         {{certificationResult}}
       </span>
     </p>
   </div>
   <el-row>
     <el-col :span=12>
       <el-button :disabled = showOne @click="distinguish">重新试别</el-button>
     </el-col>
     <el-col :span=12>
       <el-button :disabled = showTwo @click="change">下一步</el-button>
     </el-col>
   </el-row>
  </div>
</template>

<script>
export default {
  data () {
    return {
      // baseurl: 'http://222.73.213.181:9998',
      baseurl: 'https://dev.egoonet.com/app',
      imgUrl:'https://timgsa.baidu.com/timg?image&quality=80&size=b10000_10000&sec=1564714437&di=02714a9543bc3d4c989f5666af8e7d4e&src=http://www.ihongda.com/upload/editorfiles/2010.8.9_17.5.32_5549.jpg',
      imaDate: 'data:image/jpg;base64,',
      BASE64code: 'data:image/png;base64,',
      frontUrl: 'data:image/png;base64,',
      backUrl: 'data:image/png;base64,',
      avataUrl: 'data:image/png;base64,',
      sim: '',
      networkingVerificationResultName: '',
      certificationResult: '',
      networkingVerificationResultId: '',
      riskLevel: '',
      showOne: true,
      showTwo: true,
      retCode: false,
      EndSession: false
    }
  },
  computed: {
    frontUrlIs () {
      return this.$store.state.frontUrl
    },
    backUrlIs () {
      return this.$store.state.backUrl
    },
    avataUrlIs () {
      return this.$store.state.avataUrl
    },
    isEndSessionFun () {
      return this.$store.state.EndSession
    }
  },
  watch: {
    frontUrlIs (newVal, oldVal) {
      this.frontUrl = newVal
      this.getDataPhoto()
    },
    backUrlIs (newVal, oldVal) {
      this.backUrl = newVal

    },
    avataUrlIs (newVal, oldVal) {
      this.avataUrl = newVal
      this.getInfo()
    },
    isEndSessionFun (newVal, oldVal) {
      this.EndSession = newVal
      console.log('EndSessionssssssssssssssssssssssssss')
      this.frontUrl = 'data:image/png;base64,',
      this.backUrl = 'data:image/png;base64,',
      this.avataUrl = 'data:image/png;base64,'
      this.BASE64code ='data:image/png;base64,',
      this.sim = ''
      this.networkingVerificationResultName = ''
      this.certificationResult = ''
      this.networkingVerificationResultId = ''
      this.riskLevel = ''
      this.retCode = false
    },
  },
  mounted () {
    localStorage.setItem('ICRQA', '')
    localStorage.setItem('PLAF', '')
    // this.getDataPhoto()
    // this.getInfo()
    this.$store.commit('heightLightFun', 'one')
  },
  methods: {
    distinguish() {
      this.sim = ''
      this.networkingVerificationResultName = ''
      this.certificationResult = ''
      this.networkingVerificationResultId = ''
      this.riskLevel = ''
      this.retCode = false
      this.avataUrl = 'data:image/png;base64,'
    },
    getInfo() {
       let data = {
        idurl: this.frontUrl,
        photoUrl: this.avataUrl
      }
      this.$axios({
        method: 'post',
        url: this.baseurl+'/v1/identification/photoIdentification',
        data: data
      }).then((res)=>{
        console.log('getInfo')
        console.log(res.data)
          if(res.data.retCode === 200){
            this.retCode = true
            this.sim = res.data.data.sim // 分数
            this.networkingVerificationResultName = res.data.data.networkingVerificationResultName //文字
            this.certificationResult = res.data.data.certificationResult //通过
            this.networkingVerificationResultId = res.data.data.networkingVerificationResultId //文字数字
            this.riskLevel = res.data.data.riskLevel //风险
            if (this.certificationResult == '不通过') {
              this.showTwo = true
              this.showOne = false
            } else {
              this.showTwo = false
              this.showOne = true
            }
          }
      })
    },
    getDataPhoto () {
      let params = {
        idurl: this.frontUrl
      }
      this.$axios({
        method: 'post',
        url: this.baseurl+'/v1/identification/getPortrait',
        data: params
      }).then((res)=>{
        console.log('getDataPhoto')
        console.log(res.data)
          if(res.data.retCode === 200){
            this.BASE64code = this.imaDate + res.data.data
          }
      })
    },
    change () {
      this.$router.push('/info')
    },
    snap () {
      let data = {
        type: 'snap'
      }
      window.parent.postMessage(data, '*');
    }
  }
}
</script>

